/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import './login.css';
import account from '../../images/login/account.png';
import password from '../../images/login/password.png';
import defaultAvatar from '../../images/login/avatar.jpg';
import {Title,List,Input} from '../../share';
import {getData, goNext} from '../../utils';
export default class Publish extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            account: '',
            password: '',
        }
    }
    componentDidMount(){
        //console.log(this);
    }
    goBack(){
        goNext(this,'app',3)
    }
    render() {
        return<div>
            <Title  onLeftClick={()=>this.goBack()} title="登录"/>
        <div className="cm-mlr-15">
            <div className="login-margin-40"><img src={defaultAvatar} alt="" className="login-avatar cm-border-radius"/></div>
            <List>
                <Input
                    src={account}
                    placeholder="请输入账号"
                    value={this.state.name}
                    onChange={(val)=>this.change({name:val})}
                />
            </List>
            <div className="cm-item">
                <img src={account} alt="" className="cm-img-small-icon"/><input className="cm-ml-10" type="text" placeholder="请输入账户"/></div>
            <div className="cm-item">
                <img src={password} alt="" className="cm-img-small-icon"/><input className="cm-ml-10" maxLength="8" type="password" placeholder="请输入密码"/></div>
            <div className="cm-tx-c">
                <span className="cm-btn-small login-mt-40">登录</span>
            </div>
            <div className="cm-tx-c login-operate">
                <span>快速注册</span>
                <span>|</span>
                <span>忘记密码?</span>
            </div>
        </div>
        </div>
    }
}
